import React from 'react';
import { Grid } from '@material-ui/core';
import PercentageCard from './PercentageCard';

const PercentageStats = () => {
    return (
        <Grid container spacing={2}>
            <Grid item xs={4}>
                <PercentageCard percentage={100} information="Dalam Perawatan"  />
            </Grid>
            <Grid item xs={4}>
                <PercentageCard percentage={100} information="Sembuh"  />
            </Grid>
            <Grid item xs={4}>
                <PercentageCard percentage={100} information="Meninggal"  />
            </Grid>
        </Grid>
    );
};

export default PercentageStats;
